import React from 'react';
import Editor from './Editor';
import ScriptList from './ScriptList';
import './Scripts.css';

const Scripts = () => {
    return (
        <div className='scripts-page-container'>
            <Editor className='editor' />
            <ScriptList className='script-list' />
        </div>
    );
};

export default Scripts;
